import "./app.scss"
import Home from "./home/Home";


import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

import { RouterSharp } from "@material-ui/icons";

// Default route is home
function App(){
  return (  
  <Router>
    <Routes>

      <Route path="/" element={<Home />}>
      </Route>


      <Route path='/https://github.com/CineraM/Streaming-Site' component={() => { 
        window.location.href = 'https://github.com/CineraM/Streaming-Site'; 
        return null;
      }}/>

    </Routes>
  </Router>
  );

  //return <Home />
}

export default App;
